INSERT INTO `config_info` VALUES (33, 'other.yml', 'dev', 'spring:\n    sleuth:\n        redis:\n            enabled: false\n        sampler:\n            probability: 1\n    zipkin:\n        base-url: http://192.168.61.132:9411/\n        discovery-client-enabled: false\n        sender:\n            type: web\n    cloud:\n    sentinel:\n      transport:\n      #配置sentinel dashboard地址\n        dashboard: localhost:8080\n        #默认8719端口，假如被占用会自动从8719开始依次+1扫描，直至找到未被占用的端口\n        port: 8719\n    thymeleaf:\n        cache: false\n    redis:\n        host: 192.168.61.132\n        port: 6379\n    session:\n        store-type: redis\n    cache: \n        type: redis\n        redis: \n            time-to-live: 3600000\n            use-key-prefix: true\n            cache-null-values: true\n#配置线程池\ngulimall: \n    thread:\n        coreSize: 20\n        maxSize: 200\n        keepAliveTime: 10\n\nserver:\n    servlet:\n        session:\n            timeout: 30m\n  #暴露所有端点\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \'*\'\n\n#开启feign对sentinel的支持\nfeign:\n  sentinel:\n    enabled: true\n\n#开启debug日志\nlogging:\n    level:\n        org:\n            springframework:\n                cloud:\n                    openfeign: debug\n                    sleuth: debug\n\n\n\n', 'ed2d5b63e19c48f66de9f8fda8c35207', '2022-07-19 12:47:22', '2022-10-16 05:07:28', 'nacos', '0:0:0:0:0:0:0:1', '', 'fcb3d4ad-586c-45c8-b9f6-bda916dcac44', '', '', '', 'yaml', '', '');
