INSERT INTO `his_config_info` VALUES (57, 232, 'gulimall-gateway.yaml', 'prod', '', 'server:\n  port: 8000\nspring:\n  cloud:\n    gateway:\n      globalcors:\n        corsConfigurations:\n          \'[/**]\':\n            allowCredentials: true\n            allowedOrigins: \"*\"\n            allowedMethods: \"*\"\n            allowedHeaders: \"*\"\n      discovery:\n        locator:\n          enabled: true\n      routes:\n        - id: gulimall-third-party\n          uri: lb://gulimall-third-party\n          predicates:\n            - Path=/api/third-party/**\n          filters:\n            - RewritePath=/api/?(?<segment>.*),/$\\{segment}\n\n        - id: gulimall-order\n          uri: lb://gulimall-order\n          predicates:\n            - Path=/api/order/**\n          filters:\n            - RewritePath=/api/?(?<segment>.*),/$\\{segment}\n\n        - id: gulimall-member\n          uri: lb://gulimall-member\n          predicates:\n            - Path=/api/member/**\n          filters:\n            - RewritePath=/api/?(?<segment>.*),/$\\{segment}\n\n        - id: gulimall-product\n          uri: lb://gulimall-product\n          predicates:\n            - Path=/api/product/**\n          filters:\n            - RewritePath=/api/?(?<segment>.*),/$\\{segment}\n\n        - id: gulimall-coupon\n          uri: lb://gulimall-coupon\n          predicates:\n            - Path=/api/coupon/**\n          filters:\n            - RewritePath=/api/?(?<segment>.*),/$\\{segment}\n\n        - id: gulimall-ware\n          uri: lb://gulimall-ware\n          predicates:\n            - Path=/api/ware/**\n          filters:\n            - RewritePath=/api/?(?<segment>.*),/$\\{segment}\n        - id: renren-fast\n          uri: lb://renren-fast\n          predicates:\n            - Path=/api/**\n          filters:\n            - RewritePath=/api/?(?<segment>.*),/renren-fast/$\\{segment}\n        \n        - id: gulimall_host_route\n          uri: lb://gulimall-product\n          predicates:\n            - Host=gulimall.com,item.gulimall.com\n\n        - id: gulimall_search_host_route\n          uri: lb://gulimall-elasticsearch\n          predicates:\n            - Host=search.gulimall.com\n        \n        - id: gulimall_auth_host_route\n          uri: lb://gulimall-auth\n          predicates:\n            - Host=auth.gulimall.com\n\n        - id: gulimall_cart_host_route\n          uri: lb://gulimall-cart\n          predicates:\n            - Host=cart.gulimall.com\n\n        - id: gulimall_order_host_route\n          uri: lb://gulimall-order\n          predicates:\n            - Host=order.gulimall.com\n        \n        - id: gulimall_member_host_route\n          uri: lb://gulimall-member\n          predicates:\n            - Host=member.gulimall.com', 'd49a3f4ec2a007f35364a52293ad3345', '2022-10-10 10:12:24', '2022-10-10 12:07:26', 'nacos', '0:0:0:0:0:0:0:1', 'U', 'b0a57427-8b02-4efa-ae57-9731de511a14', '');
