INSERT INTO `his_config_info` VALUES (43, 293, 'renren-test.yml', 'test', '', 'spring:\n    sleuth:\n        sampler:\n            probability: 1\n    zipkin:\n        base-url: http://192.168.61.132:9411/\n        discovery-client-enabled: false\n        sender:\n            type: web\n    datasource:\n        type: com.alibaba.druid.pool.DruidDataSource\n        druid:\n            driver-class-name: com.mysql.cj.jdbc.Driver\n            url: jdbc:mysql://192.168.61.132:3306/renren-fast?useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai\n            username: renren\n            password: 123456\n            initial-size: 10\n            max-active: 100\n            min-idle: 10\n            max-wait: 60000\n            pool-prepared-statements: true\n            max-pool-prepared-statement-per-connection-size: 20\n            time-between-eviction-runs-millis: 60000\n            min-evictable-idle-time-millis: 300000\n            #Oracle需要打开注释\n            #validation-query: SELECT 1 FROM DUAL\n            test-while-idle: true\n            test-on-borrow: false\n            test-on-return: false\n            stat-view-servlet:\n                enabled: true\n                url-pattern: /druid/*\n                #login-username: admin\n                #login-password: admin\n            filter:\n                stat:\n                    log-slow-sql: true\n                    slow-sql-millis: 1000\n                    merge-sql: false\n                wall:\n                    config:\n                        multi-statement-allow: true\n\n\n##多数据源的配置\n#dynamic:\n#  datasource:\n#    slave1:\n#      driver-class-name: com.microsoft.sqlserver.jdbc.SQLServerDriver\n#      url: jdbc:sqlserver://localhost:1433;DatabaseName=renren_security\n#      username: sa\n#      password: 123456\n#    slave2:\n#      driver-class-name: org.postgresql.Driver\n#      url: jdbc:postgresql://localhost:5432/renren_security\n#      username: renren\n#      password: 123456', '1db2977c2b142b970ff4ce1983a0fa68', '2022-10-16 05:05:32', '2022-10-16 05:05:31', 'nacos', '0:0:0:0:0:0:0:1', 'U', 'f5823caf-1662-4dff-a497-c7a9fa7b6475', '');
INSERT INTO `his_config_info` VALUES (45, 294, 'renren-fast.yaml', 'prod', '', '# Tomcat\nserver:\n  tomcat:\n    uri-encoding: UTF-8\n    max-threads: 1000\n    min-spare-threads: 30\n  port: 8006\n#  connection-timeout: 5000ms\n  servlet:\n    context-path: /renren-fast\n\nspring:\n  # 环境 dev|test|prod\n  # profiles:\n  #   active: dev\n  # jackson时间格式化\n  jackson:\n    time-zone: GMT+8\n    date-format: yyyy-MM-dd HH:mm:ss\n  servlet:\n    multipart:\n      max-file-size: 100MB\n      max-request-size: 100MB\n      enabled: true\n  redis:\n    open: true  # 是否开启redis缓存  true开启   false关闭\n    database: 0\n    host: localhost\n    port: 6379\n    password:    # 密码（默认为空）\n    timeout: 6000ms  # 连接超时时长（毫秒）\n    jedis:\n      pool:\n        max-active: 1000  # 连接池最大连接数（使用负值表示没有限制）\n        max-wait: -1ms      # 连接池最大阻塞等待时间（使用负值表示没有限制）\n        max-idle: 10      # 连接池中的最大空闲连接\n        min-idle: 5       # 连接池中的最小空闲连接\n  mvc:\n    throw-exception-if-no-handler-found: true\n    pathmatch:\n      matching-strategy: ANT_PATH_MATCHER\n#  resources:\n#    add-mappings: false\n\n\n#mybatis\nmybatis-plus:\n  mapper-locations: classpath*:/mapper/**/*.xml\n  #实体扫描，多个package用逗号或者分号分隔\n  typeAliasesPackage: io.renren.modules.*.entity\n  global-config:\n    #数据库相关配置\n    db-config:\n      #主键类型  AUTO:\"数据库ID自增\", INPUT:\"用户输入ID\", ID_WORKER:\"全局唯一ID (数字类型唯一ID)\", UUID:\"全局唯一ID UUID\";\n      id-type: AUTO\n      logic-delete-value: -1\n      logic-not-delete-value: 0\n    banner: false\n  #原生配置\n  configuration:\n    map-underscore-to-camel-case: true\n    cache-enabled: false\n    call-setters-on-nulls: true\n    jdbc-type-for-null: \'null\'\n\n\nrenren:\n  redis:\n    open: false\n  shiro:\n    redis: false\n  # APP模块，是通过jwt认证的，如果要使用APP模块，则需要修改【加密秘钥】\n  jwt:\n    # 加密秘钥\n    secret: f4e2e52034348f86b67cde581c0f9eb5[www.renren.io]\n    # token有效时长，7天，单位秒\n    expire: 604800\n    header: token', '6a37045b8f28bcb5b776c94edfab2c1b', '2022-10-16 05:06:26', '2022-10-16 05:06:25', 'nacos', '0:0:0:0:0:0:0:1', 'U', 'f5823caf-1662-4dff-a497-c7a9fa7b6475', '');
